import React, { useEffect, useState } from 'react'
import { useAuth } from '../../../../context/AuthContext'
import { useTrans } from '../../../../context/TransactionContext'




function FixedDepositInsight({ data }) {
    const { auth } = useAuth()
    const { trans } = useTrans();
    const [selector, setSelector] = useState({})
    const [profit, setProfit] = useState({})

    const dataProcessing = async () => {
      const dataFixedDeposit = data?.dataFixedDeposit || [];
      setSelector(dataFixedDeposit)
    }

    useEffect(() => {
        dataProcessing();
    }, [trans])


    useEffect(() => {

    }, [selector])

    return (
        <>
        <pre>{JSON.stringify(selector, null, 2)}</pre>
        {
            selector.map((val, key)=>{

                return(
                    <div key={key}>
                        <label>{val.cmt}</label>
                        <label>Interest Rate</label><strong>{val.interestRate}</strong>
                        <label>Initial Deposit</label><strong>{val.deposit}</strong>
                        <label>{val.createdAt.slice(0, 10)}--{val.date.slice(0, 10)}</label> 
                        <label>{profit}</label>                     
                    </div>
                )
            })
        }
        </>
    )
}

export default FixedDepositInsight
